import PropTypes from 'prop-types';

const MyComponent = (props) => {
  console.log(props, '프로금!!');
  return null;
};

MyComponent.defaultProps = {
  name: '기본 이름',
};

MyComponent.propTypes = {
  name: PropTypes.string,
};

export default MyComponent;
